import React from "react";

const SearchVisuals = () => {
  return (
    <>
      <div className="visuals">
        <div className="algorithm__name">
          Technique:&nbsp;&nbsp;&nbsp;&nbsp;<span id="algo_name"></span>
          <div className="array_size_cont">
            Array Size:&nbsp;&nbsp;<span id="slider_value"></span>
          </div>
        </div>

        <div className="visualizer"></div>
      </div>
    </>
  );
};

export default SearchVisuals;
